import React from "react";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import FacebookIcon from "@mui/icons-material/Facebook";
import InstagramIcon from "@mui/icons-material/Instagram";
import YouTubeIcon from "@mui/icons-material/YouTube";
import TwitterIcon from "@mui/icons-material/Twitter";
import style from "./socialmedia.module.css";


/**
 * 
 * 
 * A component that receives the social networks as a parameter from the JSON, and if the user does not have a specific social network, it will add 'not found'. If it exists, the link will be added.
 */

function SocialMediaLinks({ socialMedia }) {
   if (!socialMedia) {
     return <div>Loading...</div>; 
   }
  return (
    <div className={style["social2"]}>
      <p>
        <LinkedInIcon />
        <a href={socialMedia.LinkedIn || "#"}>
          {socialMedia.LinkedIn ? "לינקדין" : "לינקדין - לא נמצא"}
        </a>
      </p>
      <p>
        <FacebookIcon />
        <a href={socialMedia.Facebook || "#"}>
          {socialMedia.Facebook ? "פייסבוק" : "פייסבוק - לא נמצא"}
        </a>
      </p>
      <p>
        <InstagramIcon />
        <a href={socialMedia.Instagram || "#"}>
          {socialMedia.Instagram ? "אינסטגרם" : "אינסטגרם - לא נמצא"}
        </a>
      </p>
      <p>
        <YouTubeIcon />
        <a href={socialMedia.YouTube || "#"}>
          {socialMedia.YouTube ? "יוטיוב" : "יוטיוב - לא נמצא"}
        </a>
      </p>
      <p>
        <TwitterIcon />
        <a href={socialMedia.Twitter || "#"}>
          {socialMedia.Twitter ? "טוויטר" : "טוויטר - לא נמצא"}
        </a>
      </p>
    </div>
  );
}

export default SocialMediaLinks;
